                  <p className="service_desc">{data.period}</p>
                  <p className="service_desc">{data.description}</p>
                </div>
              );
            })}
          </Col>
        </Row>
        {/* <Row className="sec_sp">
        <Col lang="5">
          <h3 className="color_sec py-4">Awards & Grants</h3>
        </Col>
